import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

function Footer() {
  return (
    <footer>
        <Container>
            <Row>
                <Col>
                    Copyright &copy; Proshop
                </Col>
            </Row>
        </Container>
    </footer>
  )
}

export default Footer
